import React from "react";
import { ReactNavbar } from "react-responsive-animate-navbar";
import imageLogo from "./custome logo/Background (2).png"

const App = () => {
  const Home = () => <h1>home</h1>;
  const Login = () => <h1>Login</h1>;
  const SignUp = () => <h1>SignUp</h1>;
  const Items = () => <h1>Items</h1>;
  const Contact = () => <h1>Contact</h1>;
  const About = () => <h1>About</h1>;

  return (
    <div
      style={{ minHeight: "100vh", width: "100%" }}
    >

      <ReactNavbar
        color="black"
        logo = {imageLogo}
        menu={[
          { name: "HOME", to: "/", component: Home },
          { name: "LOGIN", to: "/login",component:Login },
          { name: "SIGNUP", to: "/signup",component:SignUp },
          { name: "ITEMS", to: "/items", component: Items },
          { name: "ABOUT THE E-MARKET", to: "/about", component: About },
          { name: "CONTACT", to: "/contact" , component: Contact },
        ]}
        social={[
          {
            name: "Linkedin",
            url: "https://www.linkedin.com/kidussintayehu",
            icon: ["fab", "linkedin-in"],
          },
          {
            name: "Facebook",
            url: "https://www.facebook.com/siant.sintayehu/",
            icon: ["fab", "facebook-f"],
          },
          {
            name: "Instagram",
            url: "https://www.instagram.com/siantsintayehu/",
            icon: ["fab", "instagram"],
          },
          {
            name: "Github",
            url: "https://github.com/kidussintayehu",
            icon: ["fab", "github"],
          },
        ]}

      />
    </div>
  );
};

export default App;
